import React, { Component } from 'react';
import './UserCard.css';

class UserCard extends Component {

  render () {
    return (
      <div className="User-card">
        <img src={this.props.data.avatar_url} className="User-icon"/>
        <label htmlFor="user_name">{this.props.data.name}</label>
      </div>
    )
  }
}

export default UserCard;
